const styleBigAvatar = {
    width: '80px',
    height: '80px',
    margin: '0px auto 15px',
  };

  const styleRaisedButton = {
    margin: '15px 15px 30px 15px',
    font: '15px Muli',
  };

  const styleToolbar = {
    background: '#FFF',
    height: '64px',
    paddingRight: '20px',
  };

  const styleLoginButton = {
    borderRadius: '2px',
    textTransform: 'none',
    font: '16px Muli',
    fontWeight: '400',
    letterSpacing: '0.01em',
    color: 'white',
    backgroundColor: '#DF4930',
  };

  const styleTextField = {
    font: '15px Muli',
    color: '#222',
    fontWeight: '300',
  };

  const styleForm = {
    margin: '7% auto',
    width: '360px',
  };

  const styleGrid = {
    margin: '0px auto',
    font: '16px Muli',
    color: '#222',
    fontWeight: '300',
    lineHeight: '1.5em',
  };

  module.exports = {
    styleBigAvatar,
    styleRaisedButton,
    styleToolbar,
    styleLoginButton,
    styleTextField,
    styleForm,
    styleGrid,
  };
